import React from 'react'
import '../css/ListItem.css'

class ListItem extends React.Component {
    render() {
        return (
            <div className="list-item" todo-id="">
                <input type="checkbox" className="check-box" todo-action="select-item" />
                <p className="todo-text" todo-action="todo-text">{this.props.todoText}</p>
                <button className="btn-done" todo-action="mark-done">Done</button>
                <button className="btn-delete" todo-action="delete-item">Delete</button>
            </div>
        );
    }
}

export default ListItem;
